import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import TodoList from "./pages/TodoList";


function App() {
  return (
    <BrowserRouter >
      <Switch>
        <Route exact path="/" render={ () => <TodoList />} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
